import React from "react";

const Navbar = () => {
    return(
        <div className="navbar">
            <span className="navbar-logo">Chatrooms</span>
            <div className="navbar-user">
                <img src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fsportscity.com%2Fjames-outman-pretty-surreal-earning-spot-on-dodgers-opening-day-roster-3%2F&psig=AOvVaw1dpJaOpvVwbizJu8zvE4s2&ust=1682083635564000&source=images&cd=vfe&ved=0CBEQjRxqFwoTCPC8v__HuP4CFQAAAAAdAAAAABAP" alt="" className="navbar-user-img"/>
                <span>Richard</span>
                <button className="navbar-button">logout</button>
            </div>
        </div>
    )
}

export default Navbar;
